import React, { useState } from "react";
import InputForm from "./components/InputForm";

const App = () => {
  const [results, setResults] = useState(null);

  const handleSimulate = async (formData) => {
    const response = await fetch("http://localhost:5000/api/simulation", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData),
    });
    const data = await response.json();
    setResults(data);
  };

  return (
    <div>
      <h1>Simulare Performanță Formula 1</h1>
      <InputForm onSimulate={handleSimulate} />
      {results && (
        <div>
          <h2>Rezultate Simulare</h2>
          <p>Timp pe Tur: {results.lapTime} secunde</p>
          <p>Viteză Maximă: {results.maxSpeed} km/h</p>
        </div>
      )}
    </div>
  );
};

export default App;
